<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport"
        content="width=device-width,user-scalable=no,initial-scale=1.0, minimum-scale=1.0,maximum-scale=1.0" />
    <title>App</title>
    <style>
        html,
        body {
            margin: 0;
            padding: 0;
            height: 100%;
            background: black;
        }

        body {
            overflow: hidden;
        }

        #videoWrapper {
            position: relative;
            width: 100%;
            height: 100vh;
            overflow: hidden;
        }

        #bgCanvas {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            z-index: 0;
            filter: blur(20px) brightness(0.6);
        }

        video {
            position: relative;
            width: 100%;
            height: 100%;
            object-fit: contain;
            z-index: 1;
        }

        #hotspot,
        #ctaHotspot {
            position: absolute;
            transform: translate(-50%, -50%);
            z-index: 2;
            display: none;
            background-color: rgba(255, 0, 0, 0);
            cursor: pointer;
        }

        #hotspot {
            width: 150px;
            height: 100px;
        }

        #ctaHotspot {
            width: 250px;
            height: 200px;
        }

        #mod1,
        #mod2,
        #mod3,
        #mod4 {
            display: none;
        }

        .hand {
            position: absolute;
            z-index: 3;
            pointer-events: none;
            display: none;
        }

        .hand img {
            width: 130px;
            height: auto;
        }

        .start {
            display: none;
            width: 100%;
            height: 100%;
            position: absolute;
            top: 0;
            left: 0;
            background: #323232;
            overflow: hidden;
            z-index: 10000;
        }

        .hdr {
            width: 100%;
            height: 20%;
            position: absolute;
            top: calc(-5% + env(safe-area-inset-top));
            left: 0;
        }

        .ftr {
            width: 100%;
            height: 20%;
            position: absolute;
            top: calc(84% + env(safe-area-inset-top));
            left: 0;
        }

        .hdr img,
        .ftr img {
            width: 100%;
            height: 100%;
            object-fit: contain;
        }

        .chs {
            position: absolute;
            display: flex;
            width: 100%;
            height: 79%;
            top: 10%;
            flex-wrap: wrap;
            align-content: center;
            justify-content: center;
            gap: 15px;
        }

        .models {
            width: calc(48% - 10px);
            height: auto;
            position: relative;
        }

        .models img {
            width: 100%;
            height: auto;
            object-fit: cover;
        }

        @media (orientation: portrait) and (min-width: 540px) {
            .models {
                width: calc(34% - 10px);
            }

            .chs {
                justify-content: space-around;
            }
        }

        @media (orientation: landscape) {
            .start::before {
                content: "";
                width: 34%;
                height: 100%;
                left: 33%;
                position: absolute;
                z-index: 1;
                border: 5px black solid;
            }

            .ftr {
                width: 35%;
                height: 25%;
                position: absolute;
                top: calc(84% + env(safe-area-inset-top));
                left: 33%;
            }

            .hdr {
                width: 35%;
                height: 25%;
                position: absolute;
                top: calc(-10% + env(safe-area-inset-top));
                left: 33%;
            }

            .chs {
                z-index: 100000;
                width: 26%;
                left: 38%;
            }
        }

        @media (orientation: landscape) and (min-width: 1000px) {
            .chs {
                width: 40%;
                left: 30%;
            }

            .ftr,
            .hdr {
                width: 40%;
                left: 30%;
            }

            .start::before {
                width: 39%;
                left: 30%;
            }
        }

        @media (orientation: landscape) and (max-width: 701px) {
            .chs {
                width: 32%;
                left: 35%;
            }
        }

        .models {
            animation: pulseScale 1s ease-in-out;
        }

        [data-model="model1"] {
            animation-delay: 1s;
        }

        [data-model="model2"] {
            animation-delay: 1.9s;
        }

        [data-model="model3"] {
            animation-delay: 2.8s;
        }

        [data-model="model4"] {
            animation-delay: 3.7s;
        }

        @keyframes pulseScale {

            0%,
            100% {
                transform: scale(1);
            }

            50% {
                transform: scale(1.05);
            }
        }

        .endCard {
            display: none;
            position: absolute;
            left: 0;
            top: 0;
            width: 100vw;
            height: 100vh;
            overflow: hidden;
            background: black;
            z-index: 999999;
        }

        .lo {
            width: 80%;
            height: auto;
            position: absolute;
            left: 10%;
            top: 15%;
        }

        .lo img {
            width: 100%;
            height: auto;
        }

        .cta {
            position: absolute;
            top: calc(60% + env(safe-area-inset-top));
            left: 20%;
            width: 60%;
            height: auto;
            animation: bounce 0.5s linear infinite alternate;
        }

        .cta img {
            width: 100%;
            height: auto;
        }

        @keyframes bounce {

            0%,
            100% {
                transform: translateY(-20px);
            }

            50% {
                transform: translateY(0px);
            }
        }

        @media (orientation: landscape) {
            .lo {
                width: 35%;
                height: auto;
                position: absolute;
                left: 32.5%;
                top: 15%;
            }

            .cta {
                top: calc(65% + env(safe-area-inset-top));
                left: 34%;
                width: 32%;
            }
        }
    </style>
</head>

    <script src="https://cdnjs.cloudflare.com/ajax/libs/gsap/3.12.2/gsap.min.js"></script>
    <script>// === Class definitions ===
        // Paste your current classes (VideoPlayerWithCanvas, Hotspot, HandIndicator) here

        class VideoPlayerWithCanvas {
            constructor(videoEl, canvasEl, blur = true, musicEl = null) {
                this.video = videoEl;
                this.canvas = canvasEl;
                this.ctx = canvasEl.getContext("2d");
                this.blur = blur;
                this.frameRequest = null;
                this.currentVideo = videoEl;
                this.music = musicEl;
                this.timelineEvents = [];
                this._timelineHandled = new Set();

                this._activeTargetEl = null; // HTML-
                this._hotspot = null;
                this._hand = null;
                this._fixedHotspots = [];
                this._viewportHotspots = [];
                this._handTargetEl = null; // NEW:   

                this._drawHandler = () => this._draw();
                this._resizeHandler = () => this._resizeCanvas();
                this._orientationHandler = () => setTimeout(() => this._resizeCanvas(), 300);
                this._visibilityHandler = () => this._handleVisibility();
                this._loopInterrupted = false;
                this._init();
            }

            _init() {
                this._resizeCanvas();
                window.addEventListener("resize", this._resizeHandler);
                window.addEventListener("orientationchange", this._orientationHandler);
                document.addEventListener("visibilitychange", this._visibilityHandler);
                this.video.addEventListener("play", this._drawHandler);
            }

            _resizeCanvas() {
                this.canvas.width = window.innerWidth;
                this.canvas.height = window.innerHeight;
                if (!this.currentVideo.paused && !this.currentVideo.ended) this._drawFrame();

                this._updateOverlayPositions();
                this._updateFixedHotspots();
                this._updateViewportHotspots();
                this._updateHandPosition(); // NEW
            }

            _drawFrame() {
                this.ctx.clearRect(0, 0, this.canvas.width, this.canvas.height);
                this.ctx.filter = this.blur ? "blur(20px) brightness(0.6)" : "none";
                this.ctx.drawImage(this.currentVideo, 0, 0, this.canvas.width, this.canvas.height);
            }

            _draw() {
                if (!this.currentVideo.paused && !this.currentVideo.ended) {
                    this._drawFrame();
                    this._checkTimeline();
                    this.frameRequest = requestAnimationFrame(this._drawHandler);
                }
            }

            onTime(time, callback) {
                const handler = () => {
                    if (this.currentVideo.currentTime >= time) {
                        this.currentVideo.removeEventListener("timeupdate", handler);
                        callback();
                    }
                };
                this.currentVideo.addEventListener("timeupdate", handler);
            }

            timeline(events) {
                this.timelineEvents = events;
                this._timelineHandled.clear();
            }
            startLoopWithRewind(loopStart, loopEnd) {
                if (!this.currentVideo) return;

                this._loopStart = loopStart;
                this._loopEnd = loopEnd;
                this._isRewinding = false;
                this._loopInterrupted = false;

                const onUpdate = () => {
                    if (
                        !this._isRewinding &&
                        !this._loopInterrupted &&
                        this.currentVideo.currentTime >= this._loopEnd
                    ) {
                        this._isRewinding = true;
                        const rewind = setInterval(() => {
                            if (this._loopInterrupted) {
                                clearInterval(rewind);
                                return;
                            }
                            this.currentVideo.currentTime -= 0.1;
                            if (this.currentVideo.currentTime <= this._loopStart) {
                                clearInterval(rewind);
                                this._isRewinding = false;
                            }
                        }, 60);
                    }
                };

                this.currentVideo.addEventListener("timeupdate", onUpdate);

                //    
                const stopLoop = () => {
                    this._loopInterrupted = true;
                    this.currentVideo.removeEventListener("timeupdate", onUpdate);
                    window.removeEventListener("pointerdown", stopLoop);
                    this.currentVideo.play(); // 
                };

                window.addEventListener("pointerdown", stopLoop);
            }
            _checkTimeline() {
                const current = this.currentVideo.currentTime;
                for (const { time, action } of this.timelineEvents) {
                    if (current >= time && !this._timelineHandled.has(time)) {
                        action();
                        this._timelineHandled.add(time);
                    }
                }
            }

            _handleVisibility() {
                if (document.hidden) {
                    this._wasPlaying = !this.currentVideo.paused;
                    this.currentVideo.pause();
                    if (this.music && !this.music.paused) this.music.pause();
                } else {
                    if (this._wasPlaying) this.currentVideo.play();
                    if (this.music && this._wasPlaying) this.music.play();
                }
            }

            swapVideo(newVideoEl) {
                cancelAnimationFrame(this.frameRequest);
                this.currentVideo = newVideoEl;
                newVideoEl.addEventListener("play", this._drawHandler);
                if (!newVideoEl.paused && !newVideoEl.ended) this._draw();
            }

            destroy() {
                cancelAnimationFrame(this.frameRequest);
                window.removeEventListener("resize", this._resizeHandler);
                window.removeEventListener("orientationchange", this._orientationHandler);
                document.removeEventListener("visibilitychange", this._visibilityHandler);
                this.currentVideo.removeEventListener("play", this._drawHandler);
            }

            registerDynamicElements(hotspot, hand) {
                this._hotspot = hotspot;
                this._hand = hand;
            }

            trackTargetEl(el) {
                this._activeTargetEl = el;
                this._updateOverlayPositions();
            }

            trackFixedHotspot(hotspot, topPercent, leftPercent) {
                this._fixedHotspots = [{ hotspot, topPercent, leftPercent }];
                this._updateFixedHotspots();
            }

            trackFixedHotspots(hotspotsList) {
                this._fixedHotspots = hotspotsList;
                this._updateFixedHotspots();
            }

            trackViewportHotspot(hotspot, topPercent, leftPercent) {
                this._viewportHotspots = [{ hotspot, topPercent, leftPercent }];
                this.trackHandTarget(hotspot.el); // NEW:   
                this._updateViewportHotspots();
            }

            trackViewportHotspots(hotspotsList) {
                this._viewportHotspots = hotspotsList;
                this._updateViewportHotspots();
            }

            trackHandTarget(el) {
                this._handTargetEl = el;
                this._updateHandPosition();
            }

            _updateOverlayPositions() {
                if (this._activeTargetEl && this._hotspot) {
                    this._hotspot.positionOverElement(this._activeTargetEl);
                }
                if (this._activeTargetEl && this._hand) {
                    this._hand.pointTo(this._activeTargetEl);
                }
            }

            _updateFixedHotspots() {
                this._fixedHotspots.forEach(({ hotspot, topPercent, leftPercent }) => {
                    hotspot.position(this.currentVideo, topPercent, leftPercent);
                });
            }

            _updateViewportHotspots() {
                this._viewportHotspots.forEach(({ hotspot, topPercent, leftPercent }) => {
                    hotspot.positionInViewport(topPercent, leftPercent);
                });
            }

            _updateHandPosition() {
                if (this._handTargetEl && this._hand) {
                    this._hand.pointTo(this._handTargetEl);
                }
            }
        }


        class Hotspot {
            constructor(el, videoWidth = 1080, videoHeight = 1920) {
                this.el = el;
                this.videoRatio = videoWidth / videoHeight;
            }

            positionOverElement(targetEl) {
                const rect = targetEl.getBoundingClientRect();
                this.el.style.top = `${rect.top + rect.height / 2}px`;
                this.el.style.left = `${rect.left + rect.width / 2}px`;
                this.el.style.transform = "translate(-50%, -50%)";
            }

            position(topPercent, leftPercent, videoEl = null) {
                let rect;

                if (videoEl && typeof videoEl.getBoundingClientRect === 'function') {
                    //     (  object-fit: contain)
                    rect = videoEl.getBoundingClientRect();
                } else {
                    //  ,   
                    const screenWidth = window.innerWidth;
                    const screenHeight = window.innerHeight;
                    const screenRatio = screenWidth / screenHeight;

                    let displayWidth, displayHeight, offsetLeft, offsetTop;
                    if (screenRatio > this.videoRatio) {
                        displayHeight = screenHeight;
                        displayWidth = screenHeight * this.videoRatio;
                    } else {
                        displayWidth = screenWidth;
                        displayHeight = screenWidth / this.videoRatio;
                    }

                    offsetLeft = (screenWidth - displayWidth) / 2;
                    offsetTop = (screenHeight - displayHeight) / 2;

                    rect = {
                        top: offsetTop,
                        left: offsetLeft,
                        width: displayWidth,
                        height: displayHeight
                    };
                }

                const top = rect.top + rect.height * topPercent;
                const left = rect.left + rect.width * leftPercent;

                this.el.style.top = `${top}px`;
                this.el.style.left = `${left}px`;
                this.el.style.transform = `translate(-50%, -50%)`;
            }

            positionInViewport(topPercent, leftPercent) {
                const screenWidth = window.innerWidth;
                const screenHeight = window.innerHeight;
                const top = screenHeight * topPercent;
                const left = screenWidth * leftPercent;
                this.el.style.top = `${top}px`;
                this.el.style.left = `${left}px`;
                this.el.style.transform = "translate(-50%, -50%)";
            }

            show() {
                this.el.style.display = "block";
            }

            hide() {
                this.el.style.display = "none";
            }

            reset() {
                this.hide();
                this.el.removeAttribute("style");
            }
        }

        class HandIndicator {
            constructor(el, offsetX = 55, offsetY = 55) {
                this.el = el;
                this.offsetX = offsetX;
                this.offsetY = offsetY;
                this.tween = null;
            }

            pointTo(targetEl) {
                const rect = targetEl.getBoundingClientRect();
                const x = rect.left + rect.width / 2 - this.offsetX;
                const y = rect.top + rect.height / 2 - this.offsetY;

                this.el.style.left = `${x}px`;
                this.el.style.top = `${y}px`;
                this.el.style.display = 'block';

                if (!this.tween) {
                    this.tween = gsap.to(this.el, {
                        scale: 0.85,
                        duration: 1.2,
                        yoyo: true,
                        repeat: -1,
                        ease: "power1.inOut"
                    });
                }
            }
            hide() {
                this.el.style.display = "none";
                this.el.style.transform = "scale(1)";
                if (this.tween) {
                    this.tween.kill();
                    this.tween = null;
                }
                gsap.set(this.el, { clearProps: "all" });
            }

            reset() {
                this.hide();
                this.el.removeAttribute("style");
            }
        }


        // === INIT ===
        const adVideo = document.getElementById("adVideo");
        const player = new VideoPlayerWithCanvas(
            adVideo,
            document.getElementById("bgCanvas"),
            true,
            document.getElementById("bgMusic")
        );

        const modVideos = {
            model1: document.getElementById("mod1"),
            model2: document.getElementById("mod2"),
            model3: document.getElementById("mod3"),
            model4: document.getElementById("mod4")
        };
        const hotspot = new Hotspot(document.getElementById("hotspot"));
        const ctaHotspot = new Hotspot(document.getElementById("ctaHotspot"));
        const hand = new HandIndicator(document.querySelector(".hand"));
        const endcard = document.querySelector(".endcard");
        player.registerDynamicElements(hotspot, hand);
        const activeHotspots = [];
        function showHotspot(hotspotName, top, left, extraStyles = {}) {
            hotspotName.position(top, left);
            hotspotName.show();

            Object.assign(hotspotName.el.style, extraStyles);

            const exists = activeHotspots.find(h => h.hotspot === hotspotName);
            if (!exists) {
                activeHotspots.push({ hotspot: hotspotName, top, left, extraStyles });
            }
        }
        window.addEventListener("resize", () => {
            activeHotspots.forEach(({ hotspot: hotspotRef, top, left, extraStyles }) => {
                hotspotRef.position(top, left);
                Object.assign(hotspotRef.el.style, extraStyles || {});
            });
        });
        const soundSet = [
            { id: "pop" },
            { id: "talk" }
        ];

        function stopSound(id) {
            const audio = document.getElementById(id);
            if (audio && !audio.paused) {
                audio.pause();
                audio.currentTime = 0;
            }
        }

        adVideo.addEventListener("ended", () => {
            adVideo.style.display = "none";
            player.canvas.style.display = "none";
            document.querySelector(".start").style.display = "block";
        });

        //  
        const modelButtons = document.querySelectorAll(".models");

        document.querySelector(".chs").addEventListener("click", (e) => {
            const btn = e.target.closest(".models");
            if (!btn) return;

            const key = btn.dataset.model;
            const targetVideo = modVideos[key];
            if (!targetVideo) return;

            console.log(" delegated CLICK:", key);

            Object.values(modVideos).forEach(video => {
                video.pause();
                video.currentTime = 0;
                video.style.display = "none";
            });

            document.querySelector(".start").style.display = "none";
            targetVideo.style.display = "block";
            player.canvas.style.display = "block";
            targetVideo.load();
            player.swapVideo(targetVideo);
            playSoundSequence(soundSet, "pop");
            playSoundSequence(soundSet, "talk");
            targetVideo.play().catch(err => {
                console.warn("   :", err);
            });
        });



        //   -   
        Object.values(modVideos).forEach(video => {
            video.addEventListener("ended", () => {
                video.style.display = "none";
                player.canvas.style.display = "none";
                document.querySelector(".endCard").style.display = "block";
            });
        });


        function playSound(id) {
            const sound = document.getElementById(id);
            if (sound) {
                sound.currentTime = 0;
                sound.play().catch((e) => {
                    console.warn(`Sound ${id} failed to play:`, e);
                });
            }
        }



        function playSoundSequence(set, soundId, customDelay = 0, customDuration = null) {
            const sound = set.find(s => s.id === soundId);
            if (!sound) return;

            setTimeout(() => {
                const audio = document.getElementById(sound.id);
                if (audio) {
                    audio.currentTime = 0;
                    audio.play().catch((e) => {
                        console.warn(`Sound ${sound.id} failed to play:`, e);
                    });

                    const stopAfter = customDuration !== null ? customDuration : sound.duration;
                    if (stopAfter) {
                        setTimeout(() => {
                            audio.pause();
                            audio.currentTime = 0;
                        }, stopAfter);
                    }
                }
            }, customDelay);
        }

        hotspot.el.addEventListener("click", () => {
            player.currentVideo.play();
            hotspot.hide();
            hand.hide();
            const soundsRaw = hotspot.el.dataset.sounds;
            if (soundsRaw) {
                try {
                    const sounds = JSON.parse(soundsRaw);
                    sounds.forEach(({ id, delay, duration }) => {
                        setTimeout(() => {
                            const audio = document.getElementById(id);
                            if (audio) {
                                audio.currentTime = 0;
                                audio.play().catch((e) => {
                                    console.warn(`Sound ${id} failed to play:`, e);
                                });

                                //    duration  
                                if (duration) {
                                    setTimeout(() => {
                                        audio.pause();
                                        audio.currentTime = 0;
                                    }, duration);
                                }
                            }
                        }, delay);
                    });
                } catch (e) {
                    console.warn("Invalid sound config in dataset:", e);
                }
            }
            const activeGroup = document.querySelector('.img-group.active'); //      
            if (activeGroup) {
                gsap.to(activeGroup, {
                    scale: 1.5,
                    duration: 0.3,
                    yoyo: true,
                    repeat: 1,
                    ease: "power2.out"
                });

            }
        });

        window.addEventListener("pointerup", () => {
            const music = document.getElementById("bgMusic");
            if (music.paused) music.play();
        }, { once: true });

        const previouslyPlaying = new Set();

        document.addEventListener("visibilitychange", () => {
            const music = document.getElementById("bgMusic");

            if (document.hidden) {
                // 1.   ,  
                previouslyPlaying.clear();

                soundSet.forEach(({ id }) => {
                    const audio = document.getElementById(id);
                    if (audio && !audio.paused) {
                        audio.pause();
                        previouslyPlaying.add(id); //   id
                    }
                });

                music.pause();

            } else {
                // 2.   ,     
                soundSet.forEach(({ id }) => {
                    if (previouslyPlaying.has(id)) {
                        const audio = document.getElementById(id);
                        if (audio) {
                            audio.play().catch((e) => console.warn(`Failed to resume ${id}:`, e));
                        }
                    }
                    music.play();
                });

                if (!player.currentVideo.paused) {
                    music.play();
                }
            }
        });

        function gameCompleted() {
            parent.postMessage('complete', '*');
            console.log("Ad experience has completed");
        };

        function handleCTA() {
            console.log("cta")
            parent.postMessage('download', '*');
            try {
                if (typeof FbPlayableAd !== 'undefined' && FbPlayableAd.onCTAClick) {
                    FbPlayableAd.onCTAClick();
                    parent.postMessage('download', '*');
                    gameCompleted();
                    return;
                }
            } catch (e) {
                console.warn('FbPlayableAd error:', e);
            }

            if (typeof AL !== 'undefined' && AL.openStoreUrl) {
                AL.openStoreUrl();
                gameCompleted();
                return;
            }

            if (typeof mraid !== 'undefined' && mraid.open) {
                mraid.open();
                gameCompleted();
                return;
            }

            //   SDK  
            console.log("CTA clicked  no supported SDK found.");
            parent.postMessage('download', '*');
            gameCompleted();
        }</script>
